// import axios from "axios";
import { request } from "./index";

/***************后台管理员接口************************************************/ 
// 登录
export function Login (data) {
  return request({
    url:"/submitForm",
    method:"POST",
    data
  })
}

// 查询所有管理员
export function getAllAdmin () {
  return request({
    url:"/adminall",
    method:"GET"
  })
}

// 增加管理员
export function addAdmin (data) {
  return request({
    url:"/admin/add",
    method:"POST",
    data
  })
}

// 删除管理员
export function deleteAdmin (data) {
  return request({
    url:"/admin/delete",
    method:"get",
    data
  })
}

// 修改管理员
export function updateAdmin (data) {
  return request({
    url:"/admin/amend",
    method:"POST",
    data
  })
}

/***************后台用户相关接口************************************************/ 

// 查询所有用户
export function getAllUser () {
  return request({
    url:"/queryuserall",
    method:"GET"
  })
}
